    var substringMatcher = function(its) {
        return function findMatches(q, cb) {
            var matches, substringRegex;
            // an array that will be populated with substring matches
            matches = [];
            // regex used to determine if a string contains the substring `q`
            substrRegex = new RegExp(q, 'i');
            // iterate through the pool of strings and for any string that
            // contains the substring `q`, add it to the `matches` array
            $.each(its, function(i, it) {
                if (substrRegex.test(it.cnspell) || substrRegex.test(it.symbol)) {
                    matches.push(it);
                }
            });
            cb(matches);
        };
    };

    $('.typeahead').typeahead({
            hint: true,
            highlight: true,
            minLength: 1,
        },
        {
            name: 'name',
            display: 'name',
            source: substringMatcher(items)
        })
    $('.typeahead').bind('typeahead:select', function(ev, suggestion) {
        if (suggestion.asset === '股票') {
            redirect_to(suggestion.symbol, 'e')
        } else if (suggestion.asset === '指数') {
            redirect_to(suggestion.symbol, 'i')
        } else {
            redirect_to(suggestion.symbol, 'f')
        }
    });

    function redirect_to(code, asset) {
        if (asset === 'e') {
            code += code.startsWith('6') ? '.sh' : '.sz'
        } else if (code.startsWith('0')) {
            code += '.sh'
        } else if (code.startsWith('3')) {
            code += '.sz'
        } else {
            alert('暂时仅支持0和3开头的沪深指数')
            return
        }
        window.location.href = 'posts/' + asset + '/' + code + '/'
    }

    function search(ele) {
        if (event.key === 'Enter') {
            redirect_to()
        }
    }
